vue3渲染流程2（setupRenderEffect）
setupRenderEffect，
涉及到响应式数据的东西的，建议先去看去看Reactivity的响应式数据包再来。
setupRenderEffect中实际用到的是一个叫componentUpdate的方法，传递給effect，创建响应，赋值給instance.update。
const prodEffectOptions = {
  scheduler: queueJob
}
instance.update = effect(componentEffect, prodEffectOptions)

componentEffect
当前测试用例instance.mounted === undefinded，利用renderComponentRoot，生成subTree，subTree是根据instance.type来生成的。
renderComponentRoot
如果组件是ShapeFlags.STATEFUL_COMPONENT类型，调用instance.render(instance.withProxy || instance.proxy, instance.renderCache)生成subTree，检测instance.type.inheritAttrs !== false，inheriAttrs的初始默认值为undefided，再次检测subTree.shapeFlag是否属于ShapeFlags.ELEMENT类型
或者ShapeFlags.COMPONENT类型，如果是则通过cloneVNode内部调用mergeProps把subTree.props与subTree.attrs合并，是不是忘记了attrs是什么东西？在initProps中，根据当前组件vnode.props所遍历得到的，本质上是vnode.props。
如果组件是ShapeFlage.FUNCTIONAL_COMPONENT，调用instance.vnode.type生成，和ShapeFlags.STATEFUL_COMPONENT类型中的合并subTree.props与instance.attrs行为一致，
但是attrs = instance.type.props ? instance.attrs : getFallthroughAttrs(instance.attrs)。getFallthroughAttrs在API DOC中有描述，这里主要是筛选出key为class、style和on开头的key。
export function renderComponentRoot(
  instance: ComponentInternalInstance
): VNode {
  const {
    type: Component, // 具名匹配 传递給Component
    parent,
    vnode, // instance 也传递了vnode 可以说是一个component的核心了吧
    proxy,
    withProxy,
    props,
    slots,
    attrs,
    emit,
    renderCache
  } = instance

  let result
  currentRenderingInstance = instance // 当前正在render的组件
  if (__DEV__) {
    accessedAttrs = false
  }
  try {
    let fallthroughAttrs
    if (vnode.shapeFlag & ShapeFlags.STATEFUL_COMPONENT) { // STATEFUL_COMPONENT渲染subtree
      // withProxy is a proxy with a different `has` trap only for
      // runtime-compiled render functions using `with` block.
      const proxyToUse = withProxy || proxy
      result = normalizeVNode(
        instance.render!.call(proxyToUse, proxyToUse!, renderCache)
      )
      fallthroughAttrs = attrs
    } else {
      // FUNCTINAL
      const render = Component as FunctionalComponent
      // in dev, mark attrs accessed if optional props (attrs === props)
      if (__DEV__ && attrs === props) {
        markAttrsAccessed()
      }
      result = normalizeVNode(
        render.length > 1
          ? render(
              props,
              __DEV__
                ? {
                    get attrs() {
                      markAttrsAccessed()
                      return attrs
                    },
                    slots,
                    emit
                  }
                : { attrs, slots, emit }
            )
          : render(props, null as any /* we know it doesn't need it */)
      )
      fallthroughAttrs = Component.props ? attrs : getFallthroughAttrs(attrs)
    }

    // attr merging
    // in dev mode, comments are preserved, and it's possible for a template
    // to have comments along side the root element which makes it a fragment
    let root = result // 先默认自身return的vnode为root组件
    let setRoot: ((root: VNode) => void) | undefined = undefined
    if (__DEV__) {
      ;[root, setRoot] = getChildRoot(result) // chilid1 undefinded
    }

    if ( // undefined !== false
      Component.inheritAttrs !== false && // 默认为undefinded
      fallthroughAttrs &&
      Object.keys(fallthroughAttrs).length
    ) {
      if (
        root.shapeFlag & ShapeFlags.ELEMENT ||
        root.shapeFlag & ShapeFlags.COMPONENT
      ) {
        root = cloneVNode(root, fallthroughAttrs)
      } else if (__DEV__ && !accessedAttrs && root.type !== Comment) {
        const allAttrs = Object.keys(attrs)
        const eventAttrs: string[] = []
        const extraAttrs: string[] = []
        for (let i = 0, l = allAttrs.length; i  renders non-element root node ` +
            `that cannot be animated.`
        )
      }
      root.transition = vnode.transition
    }
    // inherit ref
    if (Component.inheritRef && vnode.ref != null) {
      root.ref = vnode.ref
    }

    if (__DEV__ && setRoot) {
      setRoot(root)
    } else {
      result = root
    }
  } catch (err) {
    handleError(err, instance, ErrorCodes.RENDER_FUNCTION)
    result = createVNode(Comment)
  }
  currentRenderingInstance = null // 完成整个render

  return result
}

componentUpdate，根据instance.isMounted来判断是否已经挂载，如果没有挂载则调用instance.render，
调用instance.render的过程中，如果有响应式数据，将会track到当前instance.update（effect），最终生成subTree，把subTrree.props与instance.attrs合并。
